import React,{useEffect, useState} from 'react'

export default function TableData(props) {
  const {data} = props;
  return (
    <>
      {data.map((row) => {
        <tr>
          {props.headers.map((index) => {
            <td>{row[index]}</td>
          })}
        </tr>
      })}
    </>
  )
}
